import Home from "./Components/Home";
import Table from "./Components/Table";
import AboutUs from "./About";
function App() {
  const router = createBrowserRouter([
    {
      path: "/",
      element: <Main></Main>,
    },
    {
      path: "/about",
      element: <AboutUs></AboutUs>,
    },
    {
      path: "/",
      element: <Main></Main>,
    },
    {
      path: "/",
      element: <Main></Main>,
    },

  ]);
  return (
    <div>
      <RouterProvider router={router}></RouterProvider>
    </div>
  );
}

export default App;
